import React, { useState } from 'react';
import styled from 'styled-components';
import { Button } from './Button';

// Primeiro, declaramos os componentes base
const FormGroup = styled.div`
  display: flex;
  flex-direction: column;
  gap: 0.75rem;
  height: 75px;
  width: 100%;
`;

const Input = styled.input`
  height: 34px;
  padding: 0 1rem;
  background: ${({ theme }) => theme.colors.background.main};
  border: 1px solid ${({ theme }) => theme.colors.border};
  border-radius: 6px;
  color: ${({ theme }) => theme.colors.text.primary};
  font-size: 0.875rem;
  width: 100%;
`;

// Campos de Dados de Consumo - mais largos e menos altos
const ConsumptionInput = styled(Input)`
  height: 32px;
  width: 100%;
  min-width: 420px;
`;

const Select = styled(Input).attrs({ as: 'select' })`
  cursor: pointer;
  appearance: none;
  background-image: url("data:image/svg+xml,...");
  background-repeat: no-repeat;
  background-position: right 1rem center;
  padding-right: 2.5rem;
  min-width: 320px;
`;

// Dados Técnicos - mantendo o grid original que funcionava
const TechnicalGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  gap: 2rem;
  width: 100%;
  align-items: start;
`;

// Campos de Perfil de Consumo
const WorkingDaysSelect = styled(Select)`
  width: 100%;
  min-width: 300px;
  height: 32px;
`;

// Depois, os componentes que dependem deles
const PageContainer = styled.div`
  width: 100%;
  min-height: calc(100vh - 64px);
  background: ${({ theme }) => theme.type === 'dark' 
    ? theme.colors.background.dark 
    : theme.colors.background.light};
  padding: 2rem;
`;

const ClienteForm = ({ onSubmit }) => {
  const [formData, setFormData] = useState({
    // Dados de Consumo
    consumoMensal: '',
    demandaContratada: '',
    
    // Dados Técnicos
    tensaoFornecimento: 'baixa',
    classeConsumidor: 'comercial',
    modalidadeTarifaria: 'convencional',
    
    // Dados de Faturamento Atual
    custoMedioMensal: '',
    valorUltimaFatura: '',
    distribuidoraAtual: '',
    
    // Perfil de Consumo
    horarioPonta: false,
    percentualPonta: '',
    diasFuncionamento: '5',
    horarioFuncionamento: {
      inicio: '08:00',
      fim: '18:00'
    },
    
    // Dados Adicionais
    possuiGeracao: false,
    tipoGeracao: '',
    potenciaInstalada: '',
    area: '',
    numeroFuncionarios: '',
  });

  const handleChange = (field, value) => {
    setFormData(prev => ({ ...prev, [field]: value }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    
    if (!formData.consumoMensal) {
      alert('Por favor, informe o consumo mensal');
      return;
    }

    const dadosProcessados = {
      ...formData,
      consumoMensal: Number(String(formData.consumoMensal).replace(/\D/g, '')),
      demandaContratada: formData.demandaContratada ? 
        Number(String(formData.demandaContratada).replace(/\D/g, '')) : 0,
      diasFuncionamento: Number(formData.diasFuncionamento)
    };

    console.log('Dados enviados:', dadosProcessados);
    
    try {
      onSubmit(dadosProcessados);
    } catch (error) {
      console.error('Erro ao enviar dados:', error);
      alert('Erro ao buscar fornecedores. Por favor, tente novamente.');
    }
  };

  return (
    <PageContainer>
      <Form onSubmit={handleSubmit}>
        <MainSection>
          <ConsumptionSection>
            <SectionTitle>Dados de Consumo</SectionTitle>
            <FormGroup>
              <Label>Consumo Mensal (kWh)</Label>
              <ConsumptionInput
                type="number"
                name="consumoMensal"
                value={formData.consumoMensal}
                onChange={(e) => handleChange('consumoMensal', e.target.value)}
                placeholder="Ex: 30000"
              />
              <HelpText>Média dos últimos 12 meses</HelpText>
            </FormGroup>
            <FormGroup>
              <Label>Demanda Contratada (kW)</Label>
              <ConsumptionInput
                type="number"
                name="demandaContratada"
                value={formData.demandaContratada}
                onChange={(e) => handleChange('demandaContratada', e.target.value)}
                placeholder="Ex: 100"
              />
              <HelpText>Potência contratada atual</HelpText>
            </FormGroup>
          </ConsumptionSection>

          <TechnicalSection>
            <SectionTitle>Dados Técnicos</SectionTitle>
            <TechnicalGrid>
              <FormGroup>
                <Label>Tensão de Fornecimento</Label>
                <Select
                  name="tensaoFornecimento"
                  value={formData.tensaoFornecimento}
                  onChange={(e) => handleChange('tensaoFornecimento', e.target.value)}
                >
                  <option value="baixa">Baixa Tensão (BT)</option>
                  <option value="media">Média Tensão (MT)</option>
                  <option value="alta">Alta Tensão (AT)</option>
                </Select>
              </FormGroup>

              <FormGroup>
                <Label>Classe do Consumidor</Label>
                <Select
                  name="classeConsumidor"
                  value={formData.classeConsumidor}
                  onChange={(e) => handleChange('classeConsumidor', e.target.value)}
                >
                  <option value="comercial">Comercial</option>
                  <option value="industrial">Industrial</option>
                  <option value="residencial">Residencial</option>
                </Select>
              </FormGroup>

              <FormGroup>
                <Label>Modalidade Tarifária</Label>
                <Select
                  name="modalidadeTarifaria"
                  value={formData.modalidadeTarifaria}
                  onChange={(e) => handleChange('modalidadeTarifaria', e.target.value)}
                >
                  <option value="convencional">Convencional</option>
                  <option value="branca">Tarifa Branca</option>
                  <option value="verde">Tarifa Verde</option>
                  <option value="azul">Tarifa Azul</option>
                </Select>
              </FormGroup>
            </TechnicalGrid>
          </TechnicalSection>
        </MainSection>

        <ConsumptionProfileSection>
          <SectionTitle>Perfil de Consumo</SectionTitle>
          <ProfileGrid>
            <FormGroup>
              <Label>Dias de Funcionamento</Label>
              <WorkingDaysSelect
                name="diasFuncionamento"
                value={formData.diasFuncionamento}
                onChange={(e) => handleChange('diasFuncionamento', e.target.value)}
              >
                <option value="5">Segunda a Sexta</option>
                <option value="6">Segunda a Sábado</option>
                <option value="7">Todos os dias</option>
              </WorkingDaysSelect>
            </FormGroup>

            <FormGroup>
              <Label>Horário de Funcionamento</Label>
              <TimeContainer>
                <TimeInput
                  type="time"
                  name="horarioInicio"
                  value={formData.horarioFuncionamento.inicio}
                  onChange={(e) => handleChange('horarioFuncionamento', {
                    ...formData.horarioFuncionamento,
                    inicio: e.target.value
                  })}
                />
                <TimeSpan>até</TimeSpan>
                <TimeInput
                  type="time"
                  name="horarioFim"
                  value={formData.horarioFuncionamento.fim}
                  onChange={(e) => handleChange('horarioFuncionamento', {
                    ...formData.horarioFuncionamento,
                    fim: e.target.value
                  })}
                />
              </TimeContainer>
            </FormGroup>
          </ProfileGrid>
        </ConsumptionProfileSection>

        <ActionBar>
          <SubmitButton type="submit">
            Buscar
          </SubmitButton>
        </ActionBar>
      </Form>
    </PageContainer>
  );
};

